import Slider from '@material-ui/core/Slider'
import ButtonGroup from '@material-ui/core/ButtonGroup';
import Button from '@material-ui/core/Button'
import { styled } from '@material-ui/core/styles';
import { useState } from 'react';
import { blue, blueGrey } from '@material-ui/core/colors';


const myButtonGroup = styled(ButtonGroup)({
    borderColor: 'white',
    backgroundColor: 'transparent!important',
})

const mySlider = styled(Slider)({
    color: '#0bc5af'
})

const handleClickGo = () => {
    console.log("This is my first function!");
}


function valuetext(value){
    return '{value} min'
}

const Form = () => {
    const [backgroundColor, setBackgroundColor] = useState('white');

    const changeButton = () => {
        console.log("function running!")
        if (backgroundColor === 'white'){ 
            setBackgroundColor('blueGrey');
        }
        else {
            setBackgroundColor('white');
        }
    }

    const MyButton = styled(Button)({
        color: 'white',
        borderColor: 'white',
        backgroundColor: backgroundColor,
        marginLeft: '10px',
    })

    const time = 15

    return (
        <div className = "form">
            <h2>Focus
                <ButtonGroup aria-label="outlined primary button group" >
                <MyButton onClick={changeButton} > Upper Body </MyButton>
                <MyButton>Cardio</MyButton>
                <MyButton>Legs/Glutes</MyButton>
                <MyButton> Full Body</MyButton>
                </ButtonGroup>
            </h2>


            <h2 style={{marginTop: "38px"}}>Level / Intensity
                <ButtonGroup aria-label="outlined primary button group" >
                <MyButton > Low Impact </MyButton>
                <MyButton > Beginner </MyButton>
                <MyButton> Medium</MyButton>
                <MyButton>High</MyButton>
                </ButtonGroup>
            </h2>


            <h2>Total Time<Slider defaultValue={15} getAriaValueText={valuetext} area-labelledby="discrete-slider" valueLabelDisplay="auto" step={5} min={5} max={45} style={{width: "240px", marginLeft:"15px", marginTop:"30px", color: "#06564d"}}
            ></Slider></h2>


            <button className = "challengebutton"> CHALLENGE MODE!</button>
            <button className = "challengebutton" style={{marginTop: "10px"}} onClick={handleClickGo}> Let's Go!</button>
        </div>
      );
}

export default Form;
